import React, { Component } from 'react';
import './header.css';
import Acer from '../images/Acer.png'


class Header extends Component {


    handleLogin(event) {

        //prevent the form to be submitted to its action url
        event.preventDefault();
        console.log("Login button was clicked");
    }

    handleCart(event) {

        //prevent the form to be submitted to its action url
        event.preventDefault();
        console.log("Cart button was clicked");
    }

    render() {

        return (
            <div className="header">
                <div className="logo">
                    <img src={Acer} alt="Acer"></img>
                </div>
                <div className="header-center">
                    <button className="laptopButton" onClick={this.handleLaptop}> Laptop </button>
                    <button className="computerButton" onClick={this.handleComputer}> Computer </button>
                </div>
                <div className="header-right">
                    <button className="loginButton" type="Login" onClick={this.handleLogin}> Login </button>
                    <button className="cart" onClick={this.handleCart}>Cart</button>
                </div>

            </div>
        );
    }
}
export default Header;
